import React from "react";
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";

const Projects = () => {
  return (
    <div>
      <h1>Projects</h1>
      <p>Here are a few design and developent projects I've worked on.</p>
      <Card>
        <Card.Img variant="top" src="holder.js/100px180" />
        <Card.Body>
          <Card.Title>ELS.edu</Card.Title>
          <Card.Text>
            Led team in redesign and optimization of els.edu to create an
            intuitive, user-centric responsive site with best-in-class UX/UI.
            Led team in development of redesigned els.edu to create a seamless
            experience across multiple devices and fast browsing. Achieved
            annual lead targets by increasing student applications and
            enrollments after site relaunch.
          </Card.Text>
          <a href="els.edu" target="_blank" rel="noopener noreferrer">
            <Button variant="dark">Visit Website ></Button>
          </a>
        </Card.Body>
      </Card>
    </div>
  );
};

export default Projects;
